// src/pages/ContactUs.jsx
import React from "react";

export default function ContactUs() {
  return (
    <div className="bg-white dark:bg-secondary text-purple-700 dark:text-white px-4 py-20 text-center">
      <h1 className="text-4xl md:text-5xl font-extrabold mb-6">Contact Us</h1>
      <p className="text-lg md:text-xl max-w-3xl mx-auto">
        Let's talk! Reach out to us for marketing inquiries or collaboration opportunities.
      </p>
    </div>
  );
}
